import {
  BrowserRouter as Router,
  Routes,
  Route,
} from "react-router-dom";
import Home from "./pages/Home";

function App() {
  return (
    <>
      <Router>
        <div className="navbar bg-primary text-primary-content">
          <a href="/" aria-label="Welcome to Futourist" className="btn btn-ghost normal-case text-xl">FuTourist</a>
        </div>
        <Routes>
          <Route path="/" element={<Home />} />
        </Routes>

      </Router>
    </>
  );
}

export default App;
